import React, { Component } from 'react'

export default class HomePages extends Component {

    usequery(){
        return new URLSearchParams(this.props.location().search);
    }

    render() {
        let query = this.useQuery();
        return (
            <div>
                <h1>Hello From HomePages {query}</h1>
            </div>
        )
    }
}
